import React, {useState, useEffect} from 'react';

function App() {

  const [count, setCount] = useState(0);

  const increment = () => {
    setCount(count + 1);
  }



  return (
    <div className="App">

      <button onClick={increment}>Click</button>


    </div>



  );
}

export default App;
